import React from 'react';
import Axios from 'axios';
import SearchBar from './SearchBar';
import './Grid.module.css'

function DisplayImages() {

  const [post, setPost] = React.useState([]);

  React.useEffect(() => async () => {

  Axios.get("http://localhost:3000/getImagesArray").then(response => {
      setPost(response.data.imagesArray);
    });
  }, []);

  let mapAll = post.map(url => {
    return <div key = {url.id} >
      < img src = {url} alt = "images" / >

      </div>
  })

  return (<div>mapAll <SearchBar callparentfunction={() => setPost()} /></div>);
}

export default DisplayImages;
